  `gu_redbag` int(11) DEFAULT '0' COMMENT '固定红包值',
  `gu_redbagchance` decimal(10,2) DEFAULT '0.00' COMMENT '固定红包概率',
  `qu_minredbag` int(11) DEFAULT '0' COMMENT '区间最小红包值',
  `qu_maxredbag` int(11) DEFAULT '0' COMMENT '区间最大红包值',
  `qu_redbagchance` decimal(10,2) DEFAULT '0.00' COMMENT '区间红包值出现概率',
  `score_type` tinyint(4) DEFAULT '1' COMMENT '积分规则：1：固定积分；2：区间积分',
  `redbag_type` tinyint(4) DEFAULT '1' COMMENT '红包规则：1：固定红包；2：区间红包',
  `isrecommend` tinyint(4) DEFAULT '2' COMMENT '是否推荐：1：是；2：否',
  `orderby` int(11) DEFAULT NULL COMMENT '推荐排序',
  `district_1_id` int(11) DEFAULT NULL,
  `district_2_id` int(11) DEFAULT NULL,
  `district_3_id` int(11) DEFAULT NULL,
  `qrcode` varchar(255) DEFAULT NULL COMMENT '二维码',
  `qrcode_big` varchar(255) DEFAULT NULL,
  `map_address` varchar(255) DEFAULT NULL COMMENT '地图地址',
  `baidu_lng` decimal(9,6) DEFAULT NULL COMMENT '百度经度',
  `baidu_lat` decimal(9,6) DEFAULT NULL COMMENT '百度纬度',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=24 DEFAULT CHARSET=utf8;

