INSERT INTO `sys_config` VALUES ('1', '<p>同一个世界，同一个梦想。为实现中华民族伟大复兴的中国梦而不懈努力！！</p>', '<p><span style=font-family:;>&nbsp;&nbsp; 《“蚂蚁乐享”平台用户协议》（以下简称“本协议”）由日照林竹商贸有限公司（以下称之为“蚂蚁乐享平台经营者”，或简称“蚂蚁乐享”）与您就蚂蚁乐享平台服务的使用所订立的有效约定。<strong>您通过点击确认本协议或以其他方式选择接受本协议，即表示您已与蚂蚁乐享达成协议并同意接受本协议的全部约定内容。一旦您使用本服务，即表示您同意遵循本协议之所有约定。</strong></span></p><p><span style=font-family:;>&nbsp;</span></p><p><span style=font-family:;>第一条</span> <span style=font-family:;>声明与承诺</span></p><p><span style=font-family:;>&nbsp;</span></p><p><strong><span style=font-family:;>1.蚂蚁乐享提醒您认真阅读、充分理解本协议各条款，特别是其中与您的权益有或可能具有重大关系的条款，及对蚂蚁乐享具有或可能具有免责或限制责任的条款（尤其是粗体字部分）。</span></strong><span style=font-family:;>如您不同意接受本协议的任意内容，或者无法准确理解相关条款含义的，请不要进行后续操作。如果您对本协议的条款有疑问的，请拨打蚂蚁乐享客服热线进行询问，蚂蚁乐享将向您解释条款内容。</span></p><p><strong><span style=font-family:;>2.您同意，蚂蚁乐享有权随时对本协议内容进行单方面的变更，并以在本平台予以公布，无需另行单独通知您；</span></strong><span style=font-family:;>若您在本协议内容公告变更后继续使用蚂蚁乐享平台服务的，表示您已充分阅读、理解并接受修改后的协议内容，也将遵循修改后的协议内容使用蚂蚁乐享平台服务；若您不同意修改后的协议内容，您应停止使用蚂蚁乐享平台服务。</span></p><p><strong><span style=font-family:;>3.您与蚂蚁乐享因本协议的履行发生争议的，应通过友好协商解决，协商不成的，任一方有权将争议提交日照市林竹商贸有限公司住所地（日照市东港区）人民法院进行诉讼。</span></strong></p><p><strong><span style=font-family:;>4.您确认，在您开始使用蚂蚁乐享</span><span style=font-family:;>平台服务时，您应当具备中华人民共和国法律规定的与您行为相适应的民事行为能力，否则您应获得您的监护人同意且在您的监护人指导下使用蚂蚁乐享平台服务。</span></strong></p><p><span style=font-family:;>第二条</span> <span style=font-family:;>定义</span></p><p><span style=font-family:;>&nbsp;</span></p><p><span style=font-family:;>1.蚂蚁乐享平台：是指蚂蚁乐享提供互联网信息、移动互联网信息服务及相应软件技术服务的平台，蚂蚁乐享平台包括但不限于甲方根据业务需要不时修改的</span><span style=font-family:;>URL</span><span style=font-family:;>，以及相应蚂蚁乐享客户端软件（如有）、管理后台系统等，以下简称蚂蚁乐享平台。</span></p><p><span style=font-family:;>2.商家：是指与蚂蚁乐享平台经营者签署了《蚂蚁乐享商户服务协议》的主体。</span></p><p><span style=font-family:;>3.优惠信息：是蚂蚁乐享平台上的商家通过蚂蚁乐享平台发布的面向用户的优惠信息，包括但不限于折扣券、立减优惠、红包、网络团购、商家储值卡等，具体以蚂蚁乐享平台实际可发布的优惠信息为准。</span></p><p><span style=font-family:;>4.优惠凭证：是指用户在蚂蚁乐享平台上领取商家发布的优惠服务之后产生的凭证，凭证形式包括二维码、条形码及蚂蚁乐享实际可提供的其他形式。</span></p><p><span style=font-family:;>5.蚂蚁乐享平台服务：指蚂蚁乐享平台为您提供的网络信息服务及相应软件技术服务，用户可通过</span> <span style=font-family:;>“蚂蚁乐享客户端—商家”频道使用蚂蚁乐享平台服务。</span></p><p><span style=font-family:;>第三条</span> <span style=font-family:;>权利义务</span></p><p><span style=font-family:;>&nbsp;</span></p><p><span style=font-family:;>1.您理解并同意，您在使用蚂蚁乐享平台服务的同时您应使用您本人的支付宝账户和密码以及微信支付和密码进行支付，仍需遵守相关规则。</span></p><p><span style=font-family:;>2.您授权蚂蚁乐享在您使用蚂蚁乐享平台服务期间或蚂蚁乐享平台服务终止后，有权保留您在使用蚂蚁乐享平台服务期间的相关信息，同时该授权不可撤销。</span></p><p><strong><span style=font-family:;>3.您理解并同意，您应出于真实消费目的领取红包、奖励、优惠凭证，不得转售、恶意刷单或扰乱平台秩序，否则蚂蚁乐享可以将您领取的优惠凭证、奖励、红包作废，情节严重的将处于十倍的罚款或移送公安机关。同时，您应特别注意优惠凭证的有效期、预约时间及退款条件。</span></strong></p><p><span style=font-family:;>4.如您要求获得优惠凭证对应商品</span><span style=font-family:;>/</span><span style=font-family:;>服务的发票、其他付款凭证、购货凭证或服务单据，您应向相关商家提出，发票金额以您实际支付的价款为准。蚂蚁乐享不负责亦无义务向您开具发票。</span></p><p><strong><span style=font-family:;>5.您不得对优惠凭证的使用进行虚假评价或虚假投诉；您的评价内容不得违反任何法律、法规、条例或规章，以及相关行业性规定，不含有任何违反国家法律、危害国家安全统一、社会稳定、公序良俗、社会公德以及淫秽、色情、不道德、欺诈、诽谤（包括商业诽谤）、恶意竞争、非法恐吓或非法骚扰的内容；否则蚂蚁乐享有权随时予以删除。如因您发布的评论给商家、其他用户或蚂蚁乐享造成损失的，由您自行承担赔偿责任。</span></strong></p><p><span style=font-family:;>6.您不得以任何技术手段或其他方式干扰蚂蚁乐享平台的正常运行或干扰其他用户对蚂蚁乐享平台服务的使用。</span></p><p><span style=font-family:;>7.您不得以虚构事实等方式恶意诋毁蚂蚁乐享、蚂蚁乐享平台或商家的商誉。</span></p><p><strong><span style=font-family:;>8.您不得利用蚂蚁乐享所提供的服务进行与使用该等服务无关的行为，包括但不限于妨害他人名誉或隐私权；或以自己名义、匿名或冒用他人或蚂蚁乐享网名义散播诽谤、不实、威胁、不雅、猥亵、不法、攻击性或侵害他人权利的消息或文字，传播色情或其它违反社会公德的言论；传输或散布计算机病毒；从事广告或贩卖商品；从事不法交易或张贴虚假不实或引人犯罪的信息；或任何违反中华人民共和国法律或其它法令的行为。</span></strong></p><p><span style=font-family:;>9.除了遵守本协议约定的内容外，<strong>您还需要遵守蚂蚁乐享平台不时公布的其他服务条款和操作规则，包括但不限于在蚂蚁乐享平台“我的”中展示的优惠凭证领取规则、使用规则。</strong></span></p><p><span style=font-family:;></span></p><p><span style=font-family:;><br/></span></p><p><span style=font-family:;>第四条</span> <span style=font-family:;>赔偿责任限制</span></p><p><span style=font-family:;>&nbsp;</span></p><p><span style=font-family:;>1.您理解并同意，对商家提供的服务，及您使用优惠凭证在商家消费过程中产生的体验感受、服务品质等，均由商家负责，蚂蚁乐享不负有任何明示或默示的担保责任。<strong>如您与商家因优惠凭证的使用而发生任何争议，包括但不限于商家提供的商品或服务的数量、质量、价格、有效期、预约时间、商家地址、退货退款、售后服务、服务态度等问题发生争议的，您应与商家采取协商或其他方式予以解决。</strong></span></p><p><strong><span style=font-family:;>2.您理解并同意，您在使用商家提供的服务中可能产生的所有伤害及损害（包括无法确认优惠凭证而造成购买者无法使用）、疾病等均由商家负完全责任。</span></strong></p><p><strong><span style=font-family:;>3.除本协议另有约定外，在任何情况下，本公司对本协议所承担的违约赔偿责任总额不超过向您收取的当次服务费用总额。<strong><span style=font-family:;><strong><span style=font-family:;><span style=font-family:;><span style=font-family:;>&nbsp; </span></span></span></strong></span></strong></span></strong></p><p><span style=font-family:;><br/></span></p><p><span style=font-family:;>第五条知识产权条款</span></p><p>&nbsp;</p><p><span style=font-family:;><br/></span></p><p><span style=font-family:;>1.蚂蚁乐享平台所包含的全部智力成果包括但不限于数据库、网站设计、文字和图表、软件、照片、录像、音乐、声音及其前述组合，软件编译、相关源代码和软件</span><span style=font-family:;> (</span><span style=font-family:;>包括小应用程序和脚本</span><span style=font-family:;>) </span><span style=font-family:;>的知识产权权利均归蚂蚁乐享所有。您不得为商业目的复制、更改、拷贝、发送或使用前述任何材料或内容。</span></p><p><strong><span style=font-family:;>2.您点击确认本协议即视为您主动将您在蚂蚁乐享平台发表的任何形式的信息（包括但不限于文字、图片、视频、音频等）的著作权，包括但不限于：复制权、发行权、出租权、展览权、表演权、放映权、广播权、信息网络传播权、摄制权、改编权、翻译权、汇编权以及应当由著作权人享有的其他可转让权利无偿独家转让给蚂蚁乐享所有，蚂蚁乐享有权利就任何主体侵权单独提起诉讼并获得全部赔偿。</span></strong><span style=font-family:;>本协议属于《中华人民共和国著作权法》第二十五条规定的书面协议，其效力及于用户在蚂蚁乐享平台发布的任何受著作权法保护的作品内容，无论该内容形成于本协议签订前还是本协议签订后。</span></p><p><span style=font-family:;>3.您在使用蚂蚁乐享平台服务过程中不得非法使用或处分蚂蚁乐享或他人的知识产权权利。您不得将已发表于蚂蚁乐享平台的信息以任何形式发布或授权其它网站（及媒体）使用。</span></p><p><span style=font-family:;>4.在法律允许的情况下，蚂蚁乐享对于与本协议有关或由本协议引起的任何间接的、惩罚性的、特殊的、派生的损失（包括业务损失、收益损失、利润损失、商誉损失、使用数据</span> <span style=font-family:;>或其他经济利益的损失），不论是如何产生的，也不论是由对本协议的违约（包括违反保证）还是由侵权造成的，均不负有任何责任，即使事先已被告知此等损失的可能性。另外即使本协议</span> <span style=font-family:;>规定的排他性救济没有达到其基本目的，也应排除蚂蚁乐享对上述损失的责任。</span></p><p><span style=font-family:;>第七条</span> <span style=font-family:;>除外责任</span></p><p><span style=font-family:;>&nbsp;</span></p><p><strong><span style=font-family:;>蚂蚁乐享平台因下列状况无法正常运作，使您无法使用各项服务时，蚂蚁乐享不承担损害赔偿责任，该状况包括但不限于：</span></strong></p><p><span style=font-family:;>1.蚂蚁乐享平台在本网站或平台公告之系统停机维护期间。</span></p><p><span style=font-family:;>2.电信设备出现故障不能进行数据传输的。</span></p><p><span style=font-family:;>3.因台风、地震、海啸、洪水、停电、战争、恐怖袭击等不可抗力之因素，造成本公司系统障碍不能执行业务的。</span></p><p><span style=font-family:;>4.由于黑客攻击、电信、电力部门技术调整或故障、网站升级、银行方面的问题等原因而造成的服务中断或者延迟。</span></p><p><span style=font-family:;>第八条</span> <span style=font-family:;>协议的变更</span></p><p><span style=font-family:;>&nbsp;</span></p><p><span style=font-family:;>1.您同意，<strong>蚂蚁乐享可根据国家法律法规变化及维护交易秩序、保护消费者权益需要，不时修改本协议，</strong>变更后的协议（下称“变更事项”）将通过法定程序并以本协议第九条约定的方式通知您。</span></p><p><span style=font-family:;>2.<strong>如您不同意变更事项，您有权于变更事项确定的生效日前联系蚂蚁乐享反馈意见。</strong>如反馈意见得以采纳，蚂蚁乐享将酌情调整变更事项。</span></p><p><span style=font-family:;>3.如您对已生效的变更事项仍不同意的，您应当于变更事项确定的生效之日起停止使用蚂蚁乐享平台服务，变更事项对您不产生效力；<strong>如您在变更事项生效后仍继续使用蚂蚁乐享平台服务，则视为您同意已生效的变更事项。</strong></span></p><p><span style=font-family:;>第九条</span> <span style=font-family:;>通知</span></p><p><span style=font-family:;>&nbsp;</span></p><p><span style=font-family:;>1.本协议履行过程中，<strong>蚂蚁乐享向您发出的书面通知方式包括但不限于邮寄纸质通知、网站公告、电子邮件、站内信、手机短信和传真等。</strong></span></p><p><span style=font-family:;>2.<strong>您同意，蚂蚁乐享有权向您发送与蚂蚁乐享平台服务相关的电子邮件或短信息，包括但不限于优惠服务信息、蚂蚁乐享平台系统调整或升级通知、您在蚂蚁乐享平台上领取优惠凭证的状态相关的通知等。</strong></span></p><p><span style=font-family:;>第十条</span> <span style=font-family:;>协议的转让</span></p><p><span style=font-family:;>&nbsp;</span></p><p><strong><span style=font-family:;>您同意，蚂蚁乐享有权将本协议项下的权利和义务转让给关联公司，届时将通过本协议第九条规定的方式通知您。如需要您配合签署相关转让文件的，您承诺对此不持异议。</span></strong></p><p><span style=font-family:;>第十一条</span> <span style=font-family:;>协议的提前终止</span></p><p><span style=font-family:;>&nbsp;</span></p><p><strong><span style=font-family:;>您同意，出现以下任一情形的，蚂蚁乐享有权单方中止或终止本协议的部分或全部，且不需要承担任何责任：</span></strong></p><p><span style=font-family:;>1.如您违反了本协议约定的禁止性规定（禁止性规定，是指协议条款中含有“不得”、“不能”等表述的内容，不可抗力条款中的表述除外），蚂蚁乐享有权终止本协议。</span></p><p><span style=font-family:;>2.国家法律法规或政策发生变化的。</span></p><p><span style=font-family:;>3.蚂蚁乐享根据自身业务发展需要而决定随时终止本协议的。</span></p><p><br/></p>', '<p>服务条款</p>', '<p>免责声明</p>', '<p>功能介绍</p>'