INSERT INTO `sys_good` VALUES ('44', '圆椒/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712051542005179_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712051542005179.jpg', '18', '1', '<p><img title=\"1512459711502197.jpg\" alt=\"微信图片_20171205153849.jpg\" src=\"/ueditor/php/upload/image/20171205/1512459711502197.jpg\"/><img title=\"1512459715548214.jpg\" alt=\"微信图片_20171205153845.jpg\" src=\"/ueditor/php/upload/image/20171205/1512459715548214.jpg\"/></p>', '1.88', '2.58', '0', '0', '0', '2017-12-05 15:42:01', '2017-12-12 08:44:12', '2', '2', '20', '青椒具有解热镇痛、促进食欲、预防癌症、净化血液、降脂减肥的功效', '0', '500');
INSERT INTO `sys_good` VALUES ('45', '油菜/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712091126535964_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712091126535964.jpg', '18', '1', '<p><img title=\"1512459789107898.jpg\" alt=\"微信图片_20171205153812.jpg\" src=\"/ueditor/php/upload/image/20171205/1512459789107898.jpg\"/><img title=\"1512459794649149.jpg\" alt=\"微信图片_20171205153817.jpg\" src=\"/ueditor/php/upload/image/20171205/1512459794649149.jpg\"/></p>', '1.58', '1.88', '0', '0', '0', '2017-12-05 15:43:21', '2017-12-12 08:44:06', '2', '2', '21', '油菜具有清热解毒，祛风泻火、散血消肿。现代研究表明，常吃油菜，能降低血清胆固醇，减少动脉硬化形成，还能促进皮肤细胞代谢，减少色素沉着，有美容的作用。', '0', '500');
INSERT INTO `sys_good` VALUES ('114', '瘦肉/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712110825354089_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712110825354089.jpg', '19', '1', '<p><br/></p><p><img src=\"/ueditor/php/upload/image/20171211/1512951931502830.jpg\" title=\"1512951931502830.jpg\" alt=\"瘦肉2_副本.jpg\"/></p>', '13.00', '13.00', '1', '0', '0', '2017-12-08 17:03:39', '2017-12-12 15:48:59', '2', '2', '0', '为人类提供优质蛋白质和必需的脂肪酸。猪肉可提供血红素（有机铁）和促进铁吸收的半胱氨，能改善缺铁性贫血。猪肉纤维较细软，结缔组织较少，肌肉组织中含有较多的肌肉脂肪，因此经过烹饪加工后肉味特别鲜美。', '0', '500');
INSERT INTO `sys_good` VALUES ('115', '五花肉/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712081708223117_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712081708223117.jpg', '19', '1', '<p><br/></p><p><img src=\"/ueditor/php/upload/image/20171208/1512724096247045.jpg\" title=\"1512724096247045.jpg\" alt=\"42166d224f4a20a4769b09ef9a529822720ed014.jpg\"/></p><p><img src=\"/ueditor/php/upload/image/20171208/1512724090987405.jpg\" title=\"1512724090987405.jpg\" alt=\"0bd162d9f2d3572cc5b6e02a8013632763d0c3f4.jpg\"/></p>', '12.00', '12.00', '2', '0', '0', '2017-12-08 17:08:22', '2017-12-12 15:48:53', '2', '2', '0', '五花肉（又称肋条肉、三层肉）位于猪的腹部，猪腹部脂肪组织很多，其中又夹带着肌肉组织，肥瘦间隔，故作“五花肉”。这部分的瘦肉也是最嫩且最多汁，五花肉一直是一些代表性中菜的最佳主角，如梅菜扣肉、东坡肉、回锅肉等，它的肥肉遇热容易化，瘦肉久煮也不柴。', '0', '500');
INSERT INTO `sys_good` VALUES ('92', '小白菜/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712091127162333_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712091127162333.jpg', '18', '1', '<p><br/></p><p><br/></p><p><br/></p><p>&nbsp;</p><p>&nbsp;</p><p><img title=\"1512790172383564.jpg\" alt=\"80492846.jpg\" src=\"/ueditor/php/upload/image/20171209/1512790172383564.jpg\"/></p>', '1.38', '1.88', '0', '0', '0', '2017-12-08 09:50:59', '2017-12-12 08:42:09', '2', '2', '22', '小白菜叶坚挺而亮，椭圆挺而亮，叶基部渐狭成叶柄，叶柄窄。小白菜原产我国，各地都有栽培，以南方栽种最广，一年四季供应，春夏两季最多。', '0', '500');
INSERT INTO `sys_good` VALUES ('47', '杏鲍菇/250g', 'http://47.92.129.85/uploadfiles/2017/12/201712051548443471_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712051548443471.jpg', '18', '1', '<p><img title=\"1512460115498937.jpg\" alt=\"微信图片_20171205154703.jpg\" src=\"/ueditor/php/upload/image/20171205/1512460115498937.jpg\"/><img title=\"1512460119595534.jpg\" alt=\"微信图片_20171205154659.jpg\" src=\"/ueditor/php/upload/image/20171205/1512460119595534.jpg\"/></p>', '2.38', '5.00', '4', '0', '0', '2017-12-05 15:48:44', '2017-12-12 08:43:58', '2', '2', '23', '杏鲍菇，其营养丰富，富含蛋白质、碳水化合物、维生素及钙、镁、铜、锌等矿物质，可以提高人体免疫功能，还具有抗癌、降血脂、润肠胃以及美容等作用。', '0', '250');
INSERT INTO `sys_good` VALUES ('48', '芹菜/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712051554411194_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712051554411194.jpg', '18', '1', '<p><img title=\"1512460470933089.jpg\" alt=\"微信图片_20171205155305.jpg\" src=\"/ueditor/php/upload/image/20171205/1512460470933089.jpg\"/><img title=\"正在上传...\" class=\"loadingclass\" id=\"loading_jatbx2f2\" src=\"http://47.92.129.85/plugins/ui_plugins/ueditor/1.4.3/themes/default/images/spacer.gif\"/></p>', '1.48', '1.58', '5', '3', '4', '2017-12-05 15:54:41', '2017-12-12 08:43:52', '2', '2', '24', '芹菜具有清热解毒、利尿消肿、平肝降压的功效。', '12', '500');
INSERT INTO `sys_good` VALUES ('49', '羊肉/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712061325135820_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712061325135820.jpg', '19', '1', '<p><br/></p><p><img src=\"/ueditor/php/upload/image/20171206/1512538422229562.jpg\" title=\"1512538422229562.jpg\" alt=\"羊肉4.jpg\"/></p><p><img src=\"/ueditor/php/upload/image/20171206/1512538407507961.jpg\" title=\"1512538407507961.jpg\" alt=\"羊肉1.jpg\"/></p><p><br/></p><p><br/></p>', '40.00', '40.00', '0', '0', '0', '2017-12-05 15:55:18', '2017-12-12 15:49:14', '2', '2', '10', '羊肉历来被当做冬季进补的重要食品之一，寒冬吃羊肉可以益气补虚，促进血液循环，增强抵御寒冷的能力；有丰富的维生素和矿物质。', '0', '500');
INSERT INTO `sys_good` VALUES ('50', '山芹/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712051557158024_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712051557158024.jpg', '18', '1', '<p><img title=\"1512460621305629.jpg\" alt=\"微信图片_20171205155314.jpg\" src=\"/ueditor/php/upload/image/20171205/1512460621305629.jpg\"/><img title=\"正在上传...\" class=\"loadingclass\" id=\"loading_jatc0cdc\" src=\"http://47.92.129.85/plugins/ui_plugins/ueditor/1.4.3/themes/default/images/spacer.gif\"/></p>', '2.98', '4.80', '0', '0', '0', '2017-12-05 15:57:15', '2017-12-12 08:43:46', '2', '2', '25', '山芹菜可以让人们的身体变得强壮起来，同时也可以抗疲劳，也可以抗辐射，也可以降低血糖和血压，老山芹是一种很不错的减肥益智的一种食物。', '0', '500');
INSERT INTO `sys_good` VALUES ('51', '菠菜/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712051601512776_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712051601512776.jpg', '18', '1', '<p><img title=\"1512460948174752.jpg\" alt=\"微信图片_20171205160112.jpg\" src=\"/ueditor/php/upload/image/20171205/1512460948174752.jpg\"/><img title=\"1512460937773812.jpg\" alt=\"微信图片_20171205160115.jpg\" src=\"/ueditor/php/upload/image/20171205/1512460937773812.jpg\"/></p>', '2.18', '2.58', '1', '0', '0', '2017-12-05 16:01:52', '2017-12-12 08:43:40', '2', '2', '26', '菠菜中含有丰富的胡萝卜素、维生素C、钙、磷，及一定量的铁、铬、钾、维生素E、芸香贰、辅酶Q10，抗氧化剂，膳食纤维，叶酸等有益成分，能给人体提供多种营养物质，增强体质。', '0', '500');
INSERT INTO `sys_good` VALUES ('52', '菜花/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712051614479122_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712051614479122.jpg', '18', '1', '<p><img title=\"1512461673599002.jpg\" alt=\"微信图片_20171205161323.jpg\" src=\"/ueditor/php/upload/image/20171205/1512461673599002.jpg\"/><img title=\"1512461683176647.jpg\" alt=\"微信图片_20171205161331.jpg\" src=\"/ueditor/php/upload/image/20171205/1512461683176647.jpg\"/><img title=\"1512461678290987.jpg\" alt=\"微信图片_20171205161327.jpg\" src=\"/ueditor/php/upload/image/20171205/1512461678290987.jpg\"/></p>', '2.98', '3.98', '0', '0', '0', '2017-12-05 16:14:47', '2017-12-12 08:43:35', '2', '2', '27', '菜花具有解毒肝脏、清化血管、减肥瘦身、美容祛斑、增强免疫、抗癌防癌的功效。', '0', '500');
INSERT INTO `sys_good` VALUES ('53', '大米', 'http://47.92.129.85/uploadfiles/2017/12/201712051617276990_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712051617276990.jpg', '23', '1', '<p><img title=\"1512461826410905.jpg\" alt=\"1_副本.jpg\" src=\"/ueditor/php/upload/image/20171205/1512461826410905.jpg\"/><img title=\"1512461830287818.jpg\" alt=\"2_副本.jpg\" src=\"/ueditor/php/upload/image/20171205/1512461830287818.jpg\"/><img title=\"1512461836218214.jpg\" alt=\"timg3_副本.jpg\" src=\"/ueditor/php/upload/image/20171205/1512461836218214.jpg\"/><img title=\"1512461833102683.jpg\" alt=\"timg_副本.jpg\" src=\"/ueditor/php/upload/image/20171205/1512461833102683.jpg\"/></p>', '0.00', '0.00', '0', '0', '0', '2017-12-05 16:17:27', '2017-12-11 15:43:55', '2', '1', '7', '大米（Rice），是稻谷经清理、砻谷、碾米、成品整理等工序后制成的成品。 稻谷的胚与糊粉层中含有近64%的稻米营养和90%以上的人体所须的营养元素，是南方人民的主要食品。熬成米粥具有补脾、和胃、清肺功效。', '0', '500');
INSERT INTO `sys_good` VALUES ('54', '牛肉/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712051621268866_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712051621268866.jpg', '19', '1', '<p><br/></p><p><span style=\"font-size: 14px;\"></span></p><p><span style=\"font-size: 14px;\"><img src=\"/ueditor/php/upload/image/20171205/1512461971349513.jpg\" title=\"1512461971349513.jpg\" alt=\"牛肉3.jpg\"/><img src=\"/ueditor/php/upload/image/20171205/1512461951529638.jpg\" title=\"1512461951529638.jpg\" alt=\"牛肉2.jpg\"/></span></p>', '33.00', '33.00', '2', '0', '0', '2017-12-05 16:21:26', '2017-12-12 15:49:08', '2', '2', '11', '牛肉是中国第二大肉类食品，仅次于猪肉，牛肉蛋白质含量高，而脂肪含量低，所以味道鲜美，受人喜爱，享有“肉中娇子”的美称。', '0', '500');
INSERT INTO `sys_good` VALUES ('91', '猪大骨', 'http://47.92.129.85/uploadfiles/2017/12/201712061700289529_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712061700289529.jpg', '19', '2', '<p><br/></p><p><img src=\"/ueditor/php/upload/image/20171206/1512550805514879.jpg\" title=\"1512550805514879.jpg\" alt=\"大骨2.jpg\"/></p>', '0.00', '0.00', '0', '0', '0', '2017-12-06 17:00:28', '2017-12-12 14:59:08', '2', '2', '0', '猪骨除含有蛋白质、脂肪、维生素外，还含有大量磷酸钙、骨胶原等，骨头汤中含有的胶原蛋白，能增强人体制造血细胞的能力。所以对于中老年人来说，喝些骨头汤加以调理，可以减缓骨骼老化；同样，骨头汤也能有利于青少年的骨骼生长。', '0', '500');
INSERT INTO `sys_good` VALUES ('55', '胡萝卜/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712051622055019_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712051622055019.jpg', '18', '1', '<p><img title=\"1512462104522739.jpg\" alt=\"微信图片_20171205162051.jpg\" src=\"/ueditor/php/upload/image/20171205/1512462104522739.jpg\"/><img title=\"1512462116848360.jpg\" alt=\"微信图片_20171205162102.jpg\" src=\"/ueditor/php/upload/image/20171205/1512462116848360.jpg\"/><img title=\"1512462112591313.jpg\" alt=\"微信图片_20171205162058.jpg\" src=\"/ueditor/php/upload/image/20171205/1512462112591313.jpg\"/></p>', '1.38', '1.58', '0', '0', '0', '2017-12-05 16:22:05', '2017-12-12 08:43:29', '2', '2', '28', '胡萝卜具有补肝明目，清热解毒的功效，可以用于贫血、感冒、便秘、高血压等症。', '0', '500');
INSERT INTO `sys_good` VALUES ('56', '小麦粉', 'http://47.92.129.85/uploadfiles/2017/12/201712051626202110_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712051626202110.jpg', '22', '1', '<p><img src=\"/ueditor/php/upload/image/20171205/1512464036514468.jpg\" title=\"1512464036514468.jpg\" alt=\"面粉2.jpg\"/><img src=\"/ueditor/php/upload/image/20171205/1512463852171024.jpg\" title=\"1512463852171024.jpg\" alt=\"面粉.jpg\"/><img src=\"/ueditor/php/upload/image/20171205/1512463866542296.jpg\" title=\"1512463866542296.jpg\" alt=\"面粉类.jpg\"/></p>', '0.00', '0.00', '0', '0', '0', '2017-12-05 16:26:20', '2017-12-11 15:43:46', '2', '1', '14', '面粉是一种由小麦磨成的粉末。按面粉中蛋白质含量的多少，可以分为高筋面粉、中筋面粉、低筋面粉及无筋面粉。面粉（小麦粉）是中国北方大部分地区的主食。以面粉制成的食物品种繁多，花样百出，风味迥异。', '0', '500');
INSERT INTO `sys_good` VALUES ('57', '洋葱/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712051626341098_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712051626341098.jpg', '18', '1', '<p><img title=\"1512462376304109.jpg\" alt=\"微信图片_20171205162521.jpg\" src=\"/ueditor/php/upload/image/20171205/1512462376304109.jpg\"/><img title=\"1512462391259960.jpg\" alt=\"微信图片_20171205162539.jpg\" src=\"/ueditor/php/upload/image/20171205/1512462391259960.jpg\"/><img title=\"1512462384779648.jpg\" alt=\"微信图片_20171205162535.jpg\" src=\"/ueditor/php/upload/image/20171205/1512462384779648.jpg\"/></p>', '2.18', '2.98', '17', '0', '0', '2017-12-05 16:26:34', '2017-12-12 08:43:23', '2', '2', '56', '洋葱，富含钾、维生素C、叶酸、锌、硒，及纤维质等营养素，可杀菌消炎、提神健体、祛痰利尿。此外，它还能清除体内氧自由基，增强新陈代谢能力，抗衰老，预防骨质疏松，是适合中老年人的保健食物。', '0', '500');
INSERT INTO `sys_good` VALUES ('58', '小米', 'http://47.92.129.85/uploadfiles/2017/12/201712051628227958_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712051628227958.jpg', '23', '1', '<p><img title=\"1512462485683003.jpg\" alt=\"d31b0ef41bd5ad6e621b467481cb39dbb7fd3c49_副本.jpg\" src=\"/ueditor/php/upload/image/20171205/1512462485683003.jpg\"/><img title=\"1512462482904412.jpg\" alt=\"d043ad4bd11373f055df4d01a40f4bfbfaed044f_副本.jpg\" src=\"/ueditor/php/upload/image/20171205/1512462482904412.jpg\"/><img title=\"1512462479852018.jpg\" alt=\"dbb44aed2e738bd44ee9888ba48b87d6267ff944_副本.jpg\" src=\"/ueditor/php/upload/image/20171205/1512462479852018.jpg\"/></p>', '0.00', '0.00', '0', '0', '0', '2017-12-05 16:28:22', '2017-12-05 16:28:54', '2', '2', '0', '小米，原名：粟，也称作粱、狗尾草、黄粟、粟米。含丰富的蛋白质和脂肪和维生素，它不仅供食用，入药有清热、清渴，滋阴，补脾肾和肠胃等功效。', '0', '500');
INSERT INTO `sys_good` VALUES ('59', '大葱/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712051632537361_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712051632537361.jpg', '18', '1', '<p><img title=\"1512462759193068.jpg\" alt=\"微信图片_20171205163150.jpg\" src=\"/ueditor/php/upload/image/20171205/1512462759193068.jpg\"/><img title=\"1512462768968807.jpg\" alt=\"微信图片_20171205163155.jpg\" src=\"/ueditor/php/upload/image/20171205/1512462768968807.jpg\"/></p>', '2.18', '2.99', '0', '0', '0', '2017-12-05 16:32:53', '2017-12-12 08:43:17', '2', '2', '29', '大葱具有增进食欲、发汗抑菌、促进血液循环、降胆固醇、壮阳补阴、预防癌症的功效。', '0', '500');
INSERT INTO `sys_good` VALUES ('60', '姜/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712051634115015_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712051634115015.jpg', '18', '1', '<p><img title=\"1512462867632495.jpg\" alt=\"微信图片_20171205163135.jpg\" src=\"/ueditor/php/upload/image/20171205/1512462867632495.jpg\"/><img title=\"1512462872356007.jpg\" alt=\"微信图片_20171205163142.jpg\" src=\"/ueditor/php/upload/image/20171205/1512462872356007.jpg\"/></p>', '4.98', '6.98', '25', '1', '5', '2017-12-05 16:34:11', '2017-12-12 08:43:12', '2', '2', '58', '生姜，它的蛋白质、脂肪、膳食纤维、维生素含量很高，其中所含的姜辣素和二苯基庚烷类化合物的结构均具有很强的抗氧化和清除自由基作用，能增进食欲，促消化，活血驱寒，解毒。', '5', '500');
INSERT INTO `sys_good` VALUES ('62', '红豆', 'http://47.92.129.85/uploadfiles/2017/12/201712051636229674_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712051636229674.jpg', '23', '1', '<p><img title=\"1512462968306846.jpg\" alt=\"1.jpg\" src=\"/ueditor/php/upload/image/20171205/1512462968306846.jpg\"/><img title=\"1512462975453904.jpg\" alt=\"timg.jpg\" src=\"/ueditor/php/upload/image/20171205/1512462975453904.jpg\"/><img title=\"1512462973931831.jpg\" alt=\"timg4.jpg\" src=\"/ueditor/php/upload/image/20171205/1512462973931831.jpg\"/></p>', '0.00', '0.00', '0', '0', '0', '2017-12-05 16:36:22', '2017-12-11 15:43:40', '2', '2', '9', '有助养颜美容、益气养血、利水消肿。', '0', '500');
INSERT INTO `sys_good` VALUES ('68', '蒜苗/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712051652524361_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712051652524361.jpg', '18', '1', '<p><img title=\"1512463961486834.jpg\" alt=\"微信图片_20171205164435.jpg\" src=\"/ueditor/php/upload/image/20171205/1512463961486834.jpg\"/><img title=\"1512463969245330.jpg\" alt=\"微信图片_20171205164431.jpg\" src=\"/ueditor/php/upload/image/20171205/1512463969245330.jpg\"/></p>', '3.98', '4.58', '0', '0', '0', '2017-12-05 16:52:52', '2017-12-12 08:42:53', '2', '2', '30', '蒜苗具有通肠排便、降血脂、增强抵抗力、预防癌症的功效。', '0', '500');
INSERT INTO `sys_good` VALUES ('64', '玉米', 'http://47.92.129.85/uploadfiles/2017/12/201712051647206696_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712051647206696.jpg', '23', '1', '<p><img title=\"1512463620587478.jpg\" alt=\"8f63a186d8e9421c9b4273af74666891.jpg\" src=\"/ueditor/php/upload/image/20171205/1512463620587478.jpg\"/><img title=\"1512463625840051.jpg\" alt=\"1474444641FC9v3LGY.jpg\" src=\"/ueditor/php/upload/image/20171205/1512463625840051.jpg\"/><img title=\"1512463628979081.jpg\" alt=\"apic7692_sc115.com.jpg\" src=\"/ueditor/php/upload/image/20171205/1512463628979081.jpg\"/><img title=\"1512463623258676.jpg\" alt=\"0824ab18972bd407115d55d371899e510fb30901_副本.jpg\" src=\"/ueditor/php/upload/image/20171205/1512463623258676.jpg\"/></p>', '0.00', '0.00', '0', '0', '0', '2017-12-05 16:47:20', '2017-12-05 16:54:55', '2', '2', '0', '玉米是禾本科玉蜀黍属一年生草本植物。别名：玉蜀黍、棒子、包谷、包米、包粟、玉茭、苞米、珍珠米、苞芦、大芦粟。玉米味道香甜，可做各式菜肴，如玉米烙、玉米汁等，它也是工业酒精和烧酒的主要原料。', '0', '500');
INSERT INTO `sys_good` VALUES ('65', '大蒜/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712051650209968_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712051650209968.jpg', '18', '1', '<p><img title=\"1512463807581628.jpg\" alt=\"微信图片_20171205164910.jpg\" src=\"/ueditor/php/upload/image/20171205/1512463807581628.jpg\"/><img title=\"1512463817819087.jpg\" alt=\"微信图片_20171205164918.jpg\" src=\"/ueditor/php/upload/image/20171205/1512463817819087.jpg\"/></p>', '4.98', '6.12', '0', '0', '0', '2017-12-05 16:50:20', '2017-12-12 08:43:05', '2', '2', '31', '大蒜有抗菌消炎的作用，可保护肝脏，调节血糖，保护心血管，抗高血脂和动脉硬化，抗血小板凝集。', '0', '500');
INSERT INTO `sys_good` VALUES ('87', '小米粉', 'http://47.92.129.85/uploadfiles/2017/12/201712061113263107_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712061113263107.jpg', '22', '1', '<p><br/></p><p><img src=\"/ueditor/php/upload/image/20171206/1512530002425117.jpg\" title=\"1512530002425117.jpg\" alt=\"小米面粉3.jpg\"/></p><p><img src=\"/ueditor/php/upload/image/20171206/1512529990891655.jpg\" title=\"1512529990891655.jpg\" alt=\"小米面粉4.jpg\"/></p>', '0.00', '0.00', '0', '0', '0', '2017-12-06 11:13:26', '2017-12-11 15:42:58', '2', '2', '11', '小麦面由小麦精加工制作而成，小米又称为粟米，小米面是一种营养价值高的加工面粉，小米味甘咸，有清热解渴、健胃除湿、和胃安眠等功效。', '0', '500');
INSERT INTO `sys_good` VALUES ('67', '蒜黄/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712051651344737_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712051651344737.jpg', '18', '1', '<p><img title=\"1512463883848013.jpg\" alt=\"微信图片_20171205164907.jpg\" src=\"/ueditor/php/upload/image/20171205/1512463883848013.jpg\"/><img title=\"1512463889451402.jpg\" alt=\"微信图片_20171205164903.jpg\" src=\"/ueditor/php/upload/image/20171205/1512463889451402.jpg\"/></p>', '3.98', '4.58', '0', '0', '0', '2017-12-05 16:51:34', '2017-12-12 08:42:59', '2', '2', '32', '蒜黄具有消食除胀、通肠排便、防治心脏病、抗衰老、抗癌防癌的功效。', '0', '500');
INSERT INTO `sys_good` VALUES ('86', '大米粉', 'http://47.92.129.85/uploadfiles/2017/12/201712061058318594_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712061058318594.jpg', '22', '1', '<p><br/></p><p><img src=\"/ueditor/php/upload/image/20171206/1512529107626348.jpg\" title=\"1512529107626348.jpg\" alt=\"大米面3.jpg\"/></p><p><img src=\"/ueditor/php/upload/image/20171206/1512529094160868.jpg\" title=\"1512529094160868.jpg\" alt=\"大米面2.jpg\"/></p>', '0.00', '0.00', '16', '0', '0', '2017-12-06 10:58:31', '2017-12-11 15:43:04', '2', '2', '12', '大米粉是以大米为原料制作的粉状物，它是米粉系列的一个统称。', '0', '500');
INSERT INTO `sys_good` VALUES ('69', '大豆', 'http://47.92.129.85/uploadfiles/2017/12/201712051654032085_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712051654032085.jpg', '23', '1', '<p><img title=\"1512464007195021.jpg\" alt=\"d6ca7bcb0a46f21fcf0aba3df4246b600c33aea6_副本.jpg\" src=\"/ueditor/php/upload/image/20171205/1512464007195021.jpg\"/><img title=\"1512464011883134.jpg\" alt=\"dbb44aed2e738bd418aee314a38b87d6277ff90c_副本.jpg\" src=\"/ueditor/php/upload/image/20171205/1512464011883134.jpg\"/><img title=\"1512464031698138.jpg\" alt=\"d01373f082025aaf18d8641ffeedab64024f1a7f_副本.jpg\" src=\"/ueditor/php/upload/image/20171205/1512464031698138.jpg\"/></p>', '0.00', '0.00', '0', '0', '0', '2017-12-05 16:54:03', '2017-12-05 16:54:14', '2', '2', '0', '大豆通称黄豆。原产中国，大豆是中国重要粮食作物之一，已有五千年栽培历史，古称菽。中国东北为主产区，是一种其种子含有丰富植物蛋白质的作物。大豆最常用来做各种豆制品、榨取豆油、 酿造酱油和提取蛋白质。', '0', '500');
INSERT INTO `sys_good` VALUES ('70', '蒜苔/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712051655378304_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712051655378304.jpg', '18', '1', '<p><img title=\"1512464130995203.jpg\" alt=\"微信图片_20171205164856.jpg\" src=\"/ueditor/php/upload/image/20171205/1512464130995203.jpg\"/><img title=\"1512464135650981.jpg\" alt=\"微信图片_20171205164853.jpg\" src=\"/ueditor/php/upload/image/20171205/1512464135650981.jpg\"/></p>', '3.58', '4.58', '0', '0', '0', '2017-12-05 16:55:38', '2017-12-12 08:42:48', '2', '2', '33', '蒜苔具有杀菌、通便、防癌的功效。', '0', '500');
INSERT INTO `sys_good` VALUES ('71', '鸡肉', 'http://47.92.129.85/uploadfiles/2017/12/201712061327155945_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712061327155945.jpg', '19', '2', '<p><br/></p><p><img src=\"/ueditor/php/upload/image/20171206/1512538336340485.jpg\" title=\"1512538336340485.jpg\" alt=\"鸡肉3_副本.jpg\"/></p><p><img src=\"/ueditor/php/upload/image/20171206/1512538322313046.jpg\" title=\"1512538322313046.jpg\" alt=\"鸡肉2.jpg\"/></p><p><br/></p><p><br/></p>', '0.00', '0.00', '0', '0', '0', '2017-12-06 08:20:43', '2017-12-12 09:32:51', '2', '2', '16', '鸡肉肉质细嫩，滋味鲜美，由于其味较淡，因此可使用于各种料理中；蛋白质含量较多颇多，肉质之中，可以说是蛋白质中最早的肉类之一，是属于高蛋白质，低脂肪的食品。', '0', '500');
INSERT INTO `sys_good` VALUES ('72', '猪排骨', 'http://47.92.129.85/uploadfiles/2017/12/201712061329342703_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712061329342703.jpg', '19', '2', '<p><br/></p><p><img src=\"/ueditor/php/upload/image/20171206/1512538243424548.jpg\" title=\"1512538243424548.jpg\" alt=\"排骨4.jpg\"/></p><p><img src=\"/ueditor/php/upload/image/20171206/1512538229148277.jpg\" title=\"1512538229148277.jpg\" alt=\"排骨2.jpg\"/></p><p><img src=\"/ueditor/php/upload/image/20171206/1512538214330071.jpg\" title=\"1512538214330071.jpg\" alt=\"排骨3_副本.jpg\"/></p><p><br/></p><p><br/></p>', '0.00', '0.00', '0', '0', '0', '2017-12-06 08:37:05', '2017-12-11 15:43:36', '2', '2', '17', '排骨是根据部位的不同，可分为多种，其中小排是属于猪腹腔靠近肚腩部分的排骨，小排的肉层比较厚，并带有白色软骨。', '0', '500');
