INSERT INTO `sys_good` VALUES ('73', '水果萝卜/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712060908126331_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712060908126331.jpg', '18', '1', '<p><img title=\"1512522476519615.jpg\" alt=\"87258PICQGf_1024.jpg\" src=\"/ueditor/php/upload/image/20171206/1512522476519615.jpg\"/><img title=\"1512522485232754.jpg\" alt=\"23025553s.jpg\" src=\"/ueditor/php/upload/image/20171206/1512522485232754.jpg\"/></p>', '1.58', '2.58', '0', '0', '0', '2017-12-06 09:08:12', '2017-12-12 08:42:40', '2', '2', '34', '萝卜具有下气、消食、利尿、润肺祛痰、解毒生津的功效。', '0', '500');
