INSERT INTO `sys_good` VALUES ('75', '薏米', 'http://47.92.129.85/uploadfiles/2017/12/201712060910402235_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712060910402235.jpg', '23', '1', '<p><img title=\"1512522618269643.jpg\" alt=\"1.jpg\" src=\"/ueditor/php/upload/image/20171206/1512522618269643.jpg\"/><img title=\"1512522626394333.jpg\" alt=\"timg2_副本.jpg\" src=\"/ueditor/php/upload/image/20171206/1512522626394333.jpg\"/><img title=\"1512522629288679.jpg\" alt=\"timg3_副本.jpg\" src=\"/ueditor/php/upload/image/20171206/1512522629288679.jpg\"/><img title=\"1512522624608343.jpg\" alt=\"timg.jpg\" src=\"/ueditor/php/upload/image/20171206/1512522624608343.jpg\"/></p>', '0.00', '0.00', '0', '0', '0', '2017-12-06 09:10:40', '2017-12-06 09:15:28', '2', '2', '0', '薏米又叫：薏苡仁、苡仁、六谷子，为禾本科植物薏苡的种仁。其性凉，味甘、淡，入脾、肺、肾经，具有利水、健脾、除痹、清热排脓的功效。', '0', '500');
INSERT INTO `sys_good` VALUES ('76', '花生油', 'http://47.92.129.85/uploadfiles/2017/12/201712060913221837_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712060913221837.jpg', '20', '1', '<p><img src=\"/ueditor/php/upload/image/20171206/1512522745623256.jpg\" title=\"1512522745623256.jpg\" alt=\"粮油区.jpg\"/><img src=\"/ueditor/php/upload/image/20171206/1512522775883520.jpg\" title=\"1512522775883520.jpg\" alt=\"油.jpg\"/></p>', '0.00', '0.00', '0', '0', '0', '2017-12-06 09:13:22', '2017-12-06 09:15:21', '2', '1', '6', '花生油是由花生经过榨油加工制成，味道香浓。花生油淡黄透明，色泽清亮，气味芬芳，滋味可口，是一种比较容易消化的食用油。花生油含不饱和脂肪酸80%以上花生油可防止皮肤皱裂老化，防止血栓形成，还可改善大脑的记忆力，延缓脑功能的衰退。', '0', '500');
INSERT INTO `sys_good` VALUES ('77', '绿豆', 'http://47.92.129.85/uploadfiles/2017/12/201712060921302078_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712060921302078.jpg', '23', '1', '<p><img title=\"1512523281132278.jpg\" alt=\"3812b31bb051f819aef7d5cedab44aed2f73e760_副本.jpg\" src=\"/ueditor/php/upload/image/20171206/1512523281132278.jpg\"/><img title=\"1512523283212929.jpg\" alt=\"8326cffc1e178a822130280bfe03738da977e809_副本.jpg\" src=\"/ueditor/php/upload/image/20171206/1512523283212929.jpg\"/><img title=\"1512523278148431.jpg\" alt=\"94cad1c8a786c917292f3a92c13d70cf3bc75768_副本.jpg\" src=\"/ueditor/php/upload/image/20171206/1512523278148431.jpg\"/></p>', '0.00', '0.00', '0', '0', '0', '2017-12-06 09:21:30', '2017-12-06 09:38:28', '2', '2', '0', '绿豆属于豆科。别名青小豆（因其颜色青绿而得名）、菉豆、植豆等。种子和茎被广泛食用。绿豆清热之功在皮，解毒之功在肉。绿豆汤是家庭常备夏季清暑饮料，清暑开胃，老少皆宜。传统绿豆制品有绿豆糕、绿豆酒、绿豆饼、绿豆沙、绿豆粉皮等。', '0', '500');
INSERT INTO `sys_good` VALUES ('78', '冬瓜/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712060923321658_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712060923321658.jpg', '18', '1', '<p><img title=\"1512523394213704.jpg\" alt=\"5555.jpg\" src=\"/ueditor/php/upload/image/20171206/1512523394213704.jpg\"/><img title=\"1512523407425022.jpg\" alt=\"9999999999999_副本.jpg\" src=\"/ueditor/php/upload/image/20171206/1512523407425022.jpg\"/></p>', '0.98', '1.26', '0', '0', '0', '2017-12-06 09:23:32', '2017-12-12 08:42:27', '2', '2', '36', '冬瓜是一种药食两用瓜类蔬菜，性微寒，味甘淡，能清热化痰、清胃热除烦止喝，甘淡渗痢，祛湿解暑、能利小便、消除水肿的功效。', '0', '500');
INSERT INTO `sys_good` VALUES ('79', '普通鸡蛋', 'http://47.92.129.85/uploadfiles/2017/12/201712061229571895_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712061229571895.jpg', '21', '1', '<p><img src=\"/ueditor/php/upload/image/20171206/1512534593692557.jpg\" title=\"1512534593692557.jpg\" alt=\"鸡蛋3.jpg\"/><img src=\"/ueditor/php/upload/image/20171206/1512534994180781.jpg\" title=\"1512534994180781.jpg\" alt=\"鸡蛋2.jpg\"/><img src=\"/ueditor/php/upload/image/20171206/1512535004100755.jpg\" title=\"1512535004100755.jpg\" alt=\"鸡.jpg\"/></p><p><br/></p><p><br/></p><p>&nbsp; &nbsp;</p>', '4.89', '4.90', '0', '0', '0', '2017-12-06 09:25:05', '2017-12-11 15:43:24', '2', '1', '4', '鸡蛋中所含的营养成分全面丰富，而被称为“人类理想的营养库”。营养学家则称它为“完全蛋白质模式”。', '0', '500');
INSERT INTO `sys_good` VALUES ('80', '茭瓜/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712060926402792_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712060926402792.jpg', '18', '1', '<p><img title=\"1512523586600875.jpg\" alt=\"timgCAUA2K11hh.jpg\" src=\"/ueditor/php/upload/image/20171206/1512523586600875.jpg\"/><img title=\"1512523593659580.jpg\" alt=\"timgCAUA2K11hh.jpg\" src=\"/ueditor/php/upload/image/20171206/1512523593659580.jpg\"/></p>', '1.98', '2.28', '0', '0', '0', '2017-12-06 09:26:40', '2017-12-12 08:42:22', '2', '2', '37', '茭瓜具有清热解毒、减肥瘦身、保肝护肾的功效。’', '0', '500');
INSERT INTO `sys_good` VALUES ('81', '山鸡蛋', 'http://47.92.129.85/uploadfiles/2017/12/201712061237527777_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712061237527777.jpg', '21', '2', '<p>山鸡蛋<br/></p><p>&nbsp; &nbsp; &nbsp; &nbsp;笨鸡蛋氨基酸含量远高于普通鸡蛋。氨基酸是组成蛋白质的基本结构单位，能够为机体和大脑提供能量，是一切生命物质之源。笨鸡蛋拥有更加丰富的卵磷脂，远高于普通鸡蛋，卵磷脂是保护肝脏、净化血液。强心健脑，调节身心的生命营养素之一。长期食用笨鸡蛋能够明目清心、健脑益智。</p><p><br/></p><p><img src=\"/ueditor/php/upload/image/20171206/1512524018580720.jpg\" title=\"1512524018580720.jpg\" alt=\"山鸡蛋2.jpg\"/><img src=\"/ueditor/php/upload/image/20171206/1512535061114239.jpg\" title=\"1512535061114239.jpg\" alt=\"鸡蛋4.jpg\"/><img src=\"/ueditor/php/upload/image/20171206/1512534651942025.jpg\" title=\"1512534651942025.jpg\" alt=\"鸡蛋1.jpg\"/></p><p><br/></p>', '0.00', '8.99', '0', '0', '0', '2017-12-06 09:27:13', '2017-12-11 15:43:19', '2', '2', '10', '笨鸡蛋氨基酸含量远高于普通鸡蛋。氨基酸是组成蛋白质的基本结构单位，能够为机体和大脑提供能量，是一切生命物质之源。笨鸡蛋拥有更加丰富的卵磷脂，远高于普通鸡蛋，卵磷脂是保护肝脏、净化血液。强心健脑，调节身心的生命营养素之一。长期食用笨鸡蛋能够明目清心、健脑益智。', '0', '500');
INSERT INTO `sys_good` VALUES ('82', '糯米', 'http://47.92.129.85/uploadfiles/2017/12/201712061006425892_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712061006425892.jpg', '23', '1', '<p><img title=\"1512525994946196.jpg\" alt=\"a8ec8a13632762d0e39e9fb7aaec08fa513dc611_副本.jpg\" src=\"/ueditor/php/upload/image/20171206/1512525994946196.jpg\"/><img title=\"1512525999861091.jpg\" alt=\"CgQDrVG0VlaAZ7ynAAGrG8LuzUo42600.jpg\" src=\"/ueditor/php/upload/image/20171206/1512525999861091.jpg\"/><img title=\"1512525988600168.jpg\" alt=\"20150907044244860.jpg\" src=\"/ueditor/php/upload/image/20171206/1512525988600168.jpg\"/></p>', '0.00', '0.00', '0', '0', '0', '2017-12-06 10:06:42', '2017-12-06 10:06:50', '2', '2', '0', '糯米是糯稻脱壳的米，糯米含有蛋白质、脂肪、糖类、钙、磷、铁、维生素B1、维生素B2、烟酸及淀粉等，营养丰富，为温补强壮食品，具有补中益气，健脾养胃，止虚汗之功效，对食欲不佳，腹胀腹泻有一定缓解作用。', '0', '500');
INSERT INTO `sys_good` VALUES ('83', '豆油', 'http://47.92.129.85/uploadfiles/2017/12/201712061010443650_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712061010443650.jpg', '20', '1', '<p><img src=\"/ueditor/php/upload/image/20171206/1512526204139694.jpg\" title=\"1512526204139694.jpg\" alt=\"豆油1.jpg\"/><img src=\"/ueditor/php/upload/image/20171206/1512526218894270.jpg\" title=\"1512526218894270.jpg\" alt=\"豆油.jpg\"/><img src=\"/ueditor/php/upload/image/20171206/1512526238472706.jpg\" title=\"1512526238472706.jpg\" alt=\"豆油2.jpg\"/><img src=\"/ueditor/php/upload/image/20171206/1512526228658252.jpg\" title=\"1512526228658252.jpg\" alt=\"豆油4.jpg\"/></p>', '0.00', '0.00', '0', '0', '0', '2017-12-06 10:10:44', '2017-12-11 15:43:14', '2', '1', '8', '豆油取自大豆种子，大豆油是世界上产量最多的油脂，是转基因原料加工的食品，一般为淡黄、略绿、深褐色等。', '0', '500');
INSERT INTO `sys_good` VALUES ('84', '燕麦', 'http://47.92.129.85/uploadfiles/2017/12/201712061023083590_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712061023083590.jpg', '23', '1', '<p><img title=\"1512526974499436.jpg\" alt=\"1119294666_14696706724971n.jpg\" src=\"/ueditor/php/upload/image/20171206/1512526974499436.jpg\"/><img title=\"1512526984107541.jpg\" alt=\"a71ea8d3fd1f4134f39776582f1f95cad1c85e77_副本.jpg\" src=\"/ueditor/php/upload/image/20171206/1512526984107541.jpg\"/><img title=\"1512526977602047.jpg\" alt=\"1440671755469_1_m.jpg\" src=\"/ueditor/php/upload/image/20171206/1512526977602047.jpg\"/></p>', '0.00', '0.00', '0', '0', '0', '2017-12-06 10:23:08', '2017-12-06 12:38:33', '2', '2', '0', '燕麦为禾本科植物,《本草纲目》中称之为雀麦、野麦子。燕麦不易脱皮，所以被称为皮燕麦,是一种低糖、高营养、高能食品。燕麦性味甘平。能益脾养心、敛汗。有较高的营养价值。', '0', '500');
INSERT INTO `sys_good` VALUES ('85', '玉米面', 'http://47.92.129.85/uploadfiles/2017/12/201712061701196505_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712061701196505.jpg', '22', '1', '<p><br/></p><p><img src=\"/ueditor/php/upload/image/20171206/1512550786566694.jpg\" title=\"1512550786566694.jpg\" alt=\"20150824160820_40595.jpg\"/><img src=\"/ueditor/php/upload/image/20171206/1512550779587287.jpg\" title=\"1512550779587287.jpg\" alt=\"0821f43ad63a3d27dde799ef3e34d5d8.jpg\"/></p><p>&nbsp;&nbsp;<img src=\"/ueditor/php/upload/image/20171206/1512550846425141.jpg\" title=\"1512550846425141.jpg\" alt=\"fod-688003.jpg\"/><img src=\"/ueditor/php/upload/image/20171206/1512550814367723.png\" title=\"1512550814367723.png\" alt=\"146665797252593782.PNG\"/></p>', '0.00', '0.00', '0', '0', '0', '2017-12-06 10:37:38', '2017-12-11 15:43:09', '2', '2', '13', '玉米面是由玉米磨制而成，没有等级之分只有粗细之分，玉米面中有丰富的营养素，玉米面的成分是卵磷脂、亚油酸、维生素，一般皆可食用。', '0', '500');
INSERT INTO `sys_good` VALUES ('89', '玉米油', 'http://47.92.129.85/uploadfiles/2017/12/201712061459373949_thumb.png', 'http://47.92.129.85/uploadfiles/2017/12/201712061459373949.jpg', '20', '1', '<p><img src=\"/ueditor/php/upload/image/20171206/1512543545402686.jpg\" title=\"1512543545402686.jpg\" alt=\"a443348ff3613393158d505a07cd8e92.jpg\"/><img src=\"/ueditor/php/upload/image/20171206/1512543551228617.jpg\" title=\"1512543551228617.jpg\" alt=\"玉米油1.jpg\"/><img src=\"/ueditor/php/upload/image/20171206/1512543560569372.jpeg\" title=\"1512543560569372.jpeg\" alt=\"玉米油2.jpeg\"/></p>', '0.00', '0.00', '0', '0', '0', '2017-12-06 14:59:37', '2017-12-06 15:00:46', '2', '2', '0', '玉米油是从玉米的胚芽中提炼的植物油，含有丰富的不饱和脂肪酸、维生素E及多酚类物质，含反式脂肪含量较高。对老年性疾病如动脉硬化、糖尿病等具有积极的防治作用。由于天然复合维生素E的功能，对心脏疾病、血栓性静脉炎、生殖机能类障碍、肌萎缩症、营养性脑软化症均有明显的疗效和预防作用。', '0', '500');
INSERT INTO `sys_good` VALUES ('88', '香菜/250g', 'http://47.92.129.85/uploadfiles/2017/12/201712061404335951_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712061404335951.jpg', '18', '1', '<p><img title=\"1512540256302713.jpg\" alt=\"578c445fNe32da993_jpg!cc_230x230.jpg\" src=\"/ueditor/php/upload/image/20171206/1512540256302713.jpg\"/><img title=\"1512540270543032.jpg\" alt=\"576cb6c3N4fe60c83_jpg!cc_230x230.jpg\" src=\"/ueditor/php/upload/image/20171206/1512540270543032.jpg\"/></p>', '2.40', '4.88', '0', '0', '0', '2017-12-06 14:04:33', '2017-12-12 08:42:16', '2', '2', '38', '香菜具有健胃消食、祛寒解毒、软化血管、强身健体的功效。', '0', '250');
INSERT INTO `sys_good` VALUES ('93', '茼蒿/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712081003453403_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712081003453403.jpg', '18', '1', '<p><br/></p><p><img title=\"1512698618901631.jpg\" alt=\"茼蒿4_副本.jpg\" src=\"/ueditor/php/upload/image/20171208/1512698618901631.jpg\"/></p><p><img title=\"1512698608186441.jpg\" alt=\"茼蒿3_副本.jpg\" src=\"/ueditor/php/upload/image/20171208/1512698608186441.jpg\"/></p><p><img title=\"1512698601937825.jpg\" alt=\"茼蒿2_副本.jpg\" src=\"/ueditor/php/upload/image/20171208/1512698601937825.jpg\"/></p>', '2.18', '3.18', '0', '0', '0', '2017-12-08 10:03:45', '2017-12-12 08:42:03', '2', '2', '39', '茼蒿中含有特殊香味的挥发油，可消食开胃；含有丰富的维生素、胡萝卜素及多种氨基酸，可以同食，有茼之清气、菊之甘香，一般营养成分无所不备，尤其是胡萝卜素的含量超过一般蔬菜。', '0', '500');
INSERT INTO `sys_good` VALUES ('94', '西兰花/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712111444293244_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712111444293244.jpg', '18', '1', '<p><br/></p><p><br/></p><p><br/></p><p><img title=\"1512974653396559.jpg\" alt=\"QQ图片20171211144226.jpg\" src=\"/ueditor/php/upload/image/20171211/1512974653396559.jpg\"/><img title=\"1512974660148317.jpg\" alt=\"QQ图片20171211144244.jpg\" src=\"/ueditor/php/upload/image/20171211/1512974660148317.jpg\"/></p>', '2.98', '3.88', '11', '0', '0', '2017-12-08 10:14:55', '2017-12-12 08:41:57', '2', '2', '55', '西蓝花可能最显著的就是具有防癌的功效，菜花含维生素C较多，比大白菜、番茄、芹菜都高，尤其是在防治胃癌、乳腺癌反面效果尤佳。一般人群均可食用，西蓝花品质柔嫩，纤维少，水分多，风味比花椰菜更鲜美。', '0', '500');
INSERT INTO `sys_good` VALUES ('95', '芋头/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712081038465448_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712081038465448.jpg', '18', '1', '<p><br/></p><p><img title=\"1512700720703850.jpg\" alt=\"芋头3_副本.jpg\" src=\"/ueditor/php/upload/image/20171208/1512700720703850.jpg\"/></p><p><img title=\"1512700713270790.jpg\" alt=\"芋头1_副本_副本.jpg\" src=\"/ueditor/php/upload/image/20171208/1512700713270790.jpg\"/><img title=\"1512700699408097.jpg\" alt=\"芋头1_副本.jpg\" src=\"/ueditor/php/upload/image/20171208/1512700699408097.jpg\"/></p>', '2.58', '3.58', '0', '0', '0', '2017-12-08 10:38:47', '2017-12-12 08:41:51', '2', '2', '40', '芋头中富含蛋白质、钙、磷、铁、钠、胡萝卜素、维生素C、B族维生素等多种成分，芋头口感细软，绵甜香糯，易于消化而不会引起中毒是一种很好的碘性食物。', '0', '500');
INSERT INTO `sys_good` VALUES ('96', '香菇/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712081048319308_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712081048319308.jpg', '18', '1', '<p><img title=\"1512701300914939.jpg\" alt=\"香菇3_副本.jpg\" src=\"/ueditor/php/upload/image/20171208/1512701300914939.jpg\"/></p><p><img title=\"1512701292545048.jpg\" alt=\"香菇2_副本.jpg\" src=\"/ueditor/php/upload/image/20171208/1512701292545048.jpg\"/><img title=\"1512701282553918.jpg\" alt=\"香菇1_副本.jpg\" src=\"/ueditor/php/upload/image/20171208/1512701282553918.jpg\"/></p>', '9.00', '12.60', '18', '0', '0', '2017-12-08 10:48:32', '2017-12-12 08:41:46', '2', '2', '57', '香菇含有一种特有的香味物质（香菇精），形成独特的菇香，所以称为“香菇”。由于营养丰富，味道鲜美，素有“菇中之王”、“蘑菇皇后”的美称，具有高蛋白质。低脂肪、多糖和多种维生素的营养特点。', '0', '500');
INSERT INTO `sys_good` VALUES ('97', '南瓜/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712081103161069_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712081103161069.jpg', '18', '1', '<p><br/></p><p><img title=\"1512702158838823.jpg\" alt=\"南瓜3_副本.jpg\" src=\"/ueditor/php/upload/image/20171208/1512702158838823.jpg\"/></p><p><img title=\"1512702152673402.jpg\" alt=\"南瓜2_副本.jpg\" src=\"/ueditor/php/upload/image/20171208/1512702152673402.jpg\"/></p>', '1.78', '2.58', '0', '0', '0', '2017-12-08 11:03:16', '2017-12-12 08:41:40', '2', '2', '41', '南瓜的皮含有丰富的胡萝卜素和维生素，所以最好连皮一起食用，如果皮较硬，就连刀将硬的部分削去再食用，在烹调的时候，南瓜心含有相当于果肉5倍的胡萝卜素，所以尽量要全部加以利用。', '0', '500');
INSERT INTO `sys_good` VALUES ('98', '山药/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712081123205395_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712081123205395.jpg', '18', '1', '<p><br/></p><p><img title=\"1512703394482217.jpg\" alt=\"山药3_副本.jpg\" src=\"/ueditor/php/upload/image/20171208/1512703394482217.jpg\"/></p><p><img title=\"1512703387656413.jpg\" alt=\"山药2_副本.jpg\" src=\"/ueditor/php/upload/image/20171208/1512703387656413.jpg\"/><img title=\"1512703380705169.jpg\" alt=\"山药1_副本.jpg\" src=\"/ueditor/php/upload/image/20171208/1512703380705169.jpg\"/></p>', '2.99', '3.28', '92', '0', '0', '2017-12-08 11:23:20', '2017-12-12 08:41:34', '2', '2', '63', '山药因其营养丰富，自古以来就被视为物美价廉的补虚佳品，即可作主粮，又可作蔬菜，还可以制成糖葫芦之类的小吃；治疗脾胃虚弱、体倦、食少、虚汗。', '0', '500');
INSERT INTO `sys_good` VALUES ('99', '金针菇/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712081307318359_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712081307318359.jpg', '18', '1', '<p><img title=\"1512709641525070.jpg\" alt=\"金针菇3_副本.jpg\" src=\"/ueditor/php/upload/image/20171208/1512709641525070.jpg\"/></p><p><img title=\"1512709632746322.jpg\" alt=\"金针菇2_副本.jpg\" src=\"/ueditor/php/upload/image/20171208/1512709632746322.jpg\"/></p><p><img title=\"1512709614166821.jpg\" alt=\"金针菇1_副本.jpg\" src=\"/ueditor/php/upload/image/20171208/1512709614166821.jpg\"/></p>', '4.88', '4.98', '50', '0', '0', '2017-12-08 13:07:31', '2017-12-12 08:41:29', '2', '2', '61', '金针菇为真菌植物门真菌冬菇的子实体，营养丰富，清香扑鼻；其菌盖小巧细腻，黄褐色或淡黄色，干部形金针，不仅味道鲜美，而且营养丰富。是拌凉菜和火锅食品的原料之一。', '0', '500');
INSERT INTO `sys_good` VALUES ('100', '地瓜/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712091055009679_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712091055009679.jpg', '18', '1', '<p><br/></p><p><img title=\"1512788099747042.jpg\" alt=\"fanshu_2639531_副本.jpg\" src=\"/ueditor/php/upload/image/20171209/1512788099747042.jpg\"/></p><p>&nbsp;</p><p>&nbsp;</p>', '1.18', '1.68', '0', '0', '0', '2017-12-08 13:38:51', '2017-12-12 08:41:24', '2', '2', '42', '地瓜含有丰富的糖、蛋白质、纤维素和多种维生素，可谓是粮食和蔬菜中的佼佼者，主要以肥大的块根和块形等；', '0', '500');
INSERT INTO `sys_good` VALUES ('101', '藕/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712081356534820_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712081356534820.jpg', '18', '1', '<p><br/></p><p><img title=\"1512712607129390.jpg\" alt=\"莲藕3_副本.jpg\" src=\"/ueditor/php/upload/image/20171208/1512712607129390.jpg\"/></p><p><img title=\"1512712602619838.jpg\" alt=\"莲藕2_副本.jpg\" src=\"/ueditor/php/upload/image/20171208/1512712602619838.jpg\"/></p><p><img title=\"1512712596619170.jpg\" alt=\"莲藕1_副本.jpg\" src=\"/ueditor/php/upload/image/20171208/1512712596619170.jpg\"/></p>', '1.88', '2.38', '0', '0', '0', '2017-12-08 13:56:53', '2017-12-12 08:41:18', '2', '2', '43', '藕呈短圆柱形，外皮粗厚，光滑为灰白色或银灰色，内部白色；节部中央膨大，内有大小不同的孔道，若干条，排列左右对称；体较重，质脆嫩，味甜、产量高，结莲子不多；可生食也可做菜，而且药用价值相当高。', '0', '500');
INSERT INTO `sys_good` VALUES ('102', '莴苣/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712081407276985_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712081407276985.jpg', '18', '1', '<p><img title=\"1512713235605045.jpg\" alt=\"莴苣3_副本.jpg\" src=\"/ueditor/php/upload/image/20171208/1512713235605045.jpg\"/></p><p><img title=\"1512713225276529.jpg\" alt=\"莴苣2_副本.jpg\" src=\"/ueditor/php/upload/image/20171208/1512713225276529.jpg\"/></p><p><br/></p>', '1.38', '1.98', '10', '0', '0', '2017-12-08 14:07:27', '2017-12-12 08:41:11', '2', '2', '54', '莴苣味道鲜美有香气，口感鲜嫩色泽淡绿，如同碧玉一般，制作菜肴可荤可素，可凉可热，它具有独特的营养价值。含钾量较高，有利于促进排尿，减少对心房的压力，对高血和心脏病患者极为有益。', '0', '500');
INSERT INTO `sys_good` VALUES ('103', '娃娃菜/包', 'http://47.92.129.85/uploadfiles/2017/12/201712090916451786_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712090916451786.jpg', '18', '1', '<p><img title=\"1512782220550845.jpg\" alt=\"9a504fc2d562853538d278189bef76c6a7ef63dd.jpg\" src=\"/ueditor/php/upload/image/20171209/1512782220550845.jpg\"/><img title=\"1512782223862908.jpg\" alt=\"u=4156376316,1690842081&amp;fm=27&amp;gp=0.jpg\" src=\"/ueditor/php/upload/image/20171209/1512782223862908.jpg\"/></p>', '3.50', '4.00', '0', '0', '0', '2017-12-08 16:17:52', '2017-12-12 08:41:05', '2', '2', '44', '娃娃菜，外形与大白菜一致，但外形尺寸仅相当于大白菜的四分之一到五分之一，因此被称为娃娃菜，在全国各地皆有种植。富含维生素A、维生素C、维生素B族、钾、硒等。有助胃肠蠕动，促进排便，秋冬季节多吃点还有解燥利尿的作用。', '0', '500');
INSERT INTO `sys_good` VALUES ('104', '紫甘蓝/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712090943192557_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712090943192557.jpg', '18', '1', '<p><img title=\"1512783777760397.jpg\" alt=\"微信图片_20171209093325_副本.jpg\" src=\"/ueditor/php/upload/image/20171209/1512783777760397.jpg\"/><img title=\"1512783781576018.jpg\" alt=\"微信图片_20171209093620.jpg\" src=\"/ueditor/php/upload/image/20171209/1512783781576018.jpg\"/></p>', '2.18', '3.58', '0', '0', '0', '2017-12-08 16:21:17', '2017-12-12 08:41:00', '2', '2', '45', '紫甘蓝其营养丰富，含有丰富的维生素C、维生素E、维生素B及丰富的花青素甙和纤维素等，对高血压、糖尿病患者有所帮助，故备受人们的欢迎。', '0', '500');
INSERT INTO `sys_good` VALUES ('105', '豆角/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712090932124041_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712090932124041.jpg', '18', '1', '<p><img title=\"1512788223599543.jpg\" alt=\"552b7ed008eaf.jpg\" src=\"/ueditor/php/upload/image/20171209/1512788223599543.jpg\"/></p>', '4.98', '6.99', '0', '0', '0', '2017-12-08 16:23:25', '2017-12-12 08:40:55', '2', '2', '46', '长豆角含丰富维生素B、C和植物蛋白质，能使人头脑宁静.调理消化系统,消除胸膈胀满。长豆角中所含的维生素C可以刺进人体抗体的合成，可以提高人体的抗病毒作用，防治急性肠胃炎,呕吐腹泻。具有补肾、解渴健脾、益气生津的功效。', '0', '500');
INSERT INTO `sys_good` VALUES ('106', '卷心菜/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712090954589225_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712090954589225.jpg', '18', '1', '<p><img title=\"1512784477603190.jpg\" alt=\"微信图片_20171209094640.jpg\" src=\"/ueditor/php/upload/image/20171209/1512784477603190.jpg\"/><img title=\"1512784491236734.jpg\" alt=\"96i58PICd8a.jpg\" src=\"/ueditor/php/upload/image/20171209/1512784491236734.jpg\"/><img title=\"1512784486184497.jpg\" alt=\"mp26273736_1438930168067_15.jpg\" src=\"/ueditor/php/upload/image/20171209/1512784486184497.jpg\"/></p>', '1.28', '1.58', '0', '0', '0', '2017-12-08 16:37:25', '2017-12-12 08:40:49', '2', '2', '47', '卷心菜它富含维生素C、维生素B1、叶酸和钾，还富含维生素U，对胃溃疡有着很好的治疗作用。食之可补骨髓、润脏腑、益心力、壮筋骨、利脏器。', '0', '500');
INSERT INTO `sys_good` VALUES ('108', '青线椒/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712091041017617_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712091041017617.jpg', '18', '1', '<p><img title=\"1512787292429965.jpg\" alt=\"微信图片_20171209100111.jpg\" src=\"/ueditor/php/upload/image/20171209/1512787292429965.jpg\"/><img title=\"1512787299109433.jpg\" alt=\"微信图片_20171209100118.jpg\" src=\"/ueditor/php/upload/image/20171209/1512787299109433.jpg\"/></p>', '5.78', '6.99', '0', '0', '0', '2017-12-08 16:43:40', '2017-12-12 08:40:44', '2', '2', '48', '辣椒不仅能够刺激食欲，还能温胃驱寒，对于消化不良也有很好的治疗效果。', '0', '500');
