INSERT INTO `sys_good` VALUES ('110', '紫薯/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712091021267560_thumb.jpg', 'http://47.92.129.85/uploadfiles/2017/12/201712091021267560.jpg', '18', '1', '<p><img title=\"1512786075153626.jpg\" alt=\"微信图片_20171209101520.jpg\" src=\"/ueditor/php/upload/image/20171209/1512786075153626.jpg\"/><img title=\"1512786081431592.jpg\" alt=\"微信图片_20171209101526.jpg\" src=\"/ueditor/php/upload/image/20171209/1512786081431592.jpg\"/></p>', '4.18', '4.99', '0', '0', '0', '2017-12-08 16:47:16', '2017-12-12 08:40:31', '2', '2', '50', '紫薯其富含蛋白质、淀粉、果胶、纤维素、氨基酸、维生素及多种矿物质，同时还富含 硒元素和青花素。其中花青2素对100多种疾病有预防和治疗作用，丰富的纤维素，可减肥瘦身、促进肠胃蠕动。', '0', '500');
