INSERT INTO `sys_o2order` VALUES ('18', '20171207011432ID4', '56', '小麦粉', 'http://47.92.129.85/uploadfiles/2017/12/201712051626202110_thumb.jpg', '<p><img src=\"/ueditor/php/upload/image/20171205/1512464036514468.jpg\" title=\"1512464036514468.jpg\" alt=\"面粉2.jpg\"/><img src=\"/ueditor/php/upload/image/20171205/1512463852171024.jpg\" title=\"1512463852171024.jpg\" alt=\"面粉.jpg\"/><img src=\"/ueditor/php/upload/image/20171205/1512463866542296.jpg\" title=\"1512463866542296.jpg\" alt=\"面粉类.jpg\"/></p>', '2', '0.00', '4', '2', '10', '4', '2017-12-07 01:15:24', null, '5', '2017-12-07 01:14:32', '2018-01-06', null, null, '面粉是一种由小麦磨成的粉末。按面粉中蛋白质含量的多少，可以分为高筋面粉、中筋面粉、低筋面粉及无筋面粉。面粉（小麦粉）是中国北方大部分地区的主食。以面粉制成的食物品种繁多，花样百出，风味迥异。', '2');
INSERT INTO `sys_o2order` VALUES ('19', '20171207011553ID4', '81', '山鸡蛋', 'http://47.92.129.85/uploadfiles/2017/12/201712061237527777_thumb.jpg', '<p>山鸡蛋<br/></p><p>&nbsp; &nbsp; &nbsp; &nbsp;笨鸡蛋氨基酸含量远高于普通鸡蛋。氨基酸是组成蛋白质的基本结构单位，能够为机体和大脑提供能量，是一切生命物质之源。笨鸡蛋拥有更加丰富的卵磷脂，远高于普通鸡蛋，卵磷脂是保护肝脏、净化血液。强心健脑，调节身心的生命营养素之一。长期食用笨鸡蛋能够明目清心、健脑益智。</p><p><br/></p><p><img src=\"/ueditor/php/upload/image/20171206/1512524018580720.jpg\" title=\"1512524018580720.jpg\" alt=\"山鸡蛋2.jpg\"/><img src=\"/ueditor/php/upload/image/20171206/1512535061114239.jpg\" title=\"1512535061114239.jpg\" alt=\"鸡蛋4.jpg\"/><img src=\"/ueditor/php/upload/image/20171206/1512534651942025.jpg\" title=\"1512534651942025.jpg\" alt=\"鸡蛋1.jpg\"/></p><p><br/></p>', '2', '0.00', '4', '2', '50', '4', '2017-12-07 01:17:05', null, '5', '2017-12-07 01:15:53', '2018-01-06', null, null, '笨鸡蛋氨基酸含量远高于普通鸡蛋。氨基酸是组成蛋白质的基本结构单位，能够为机体和大脑提供能量，是一切生命物质之源。笨鸡蛋拥有更加丰富的卵磷脂，远高于普通鸡蛋，卵磷脂是保护肝脏、净化血液。强心健脑，调节身心的生命营养素之一。长期食用笨鸡蛋能够明目清心、健脑益智。', '2');
INSERT INTO `sys_o2order` VALUES ('20', '20171207011735ID4', '53', '大米', 'http://47.92.129.85/uploadfiles/2017/12/201712051617276990_thumb.jpg', '<p><img title=\"1512461826410905.jpg\" alt=\"1_副本.jpg\" src=\"/ueditor/php/upload/image/20171205/1512461826410905.jpg\"/><img title=\"1512461830287818.jpg\" alt=\"2_副本.jpg\" src=\"/ueditor/php/upload/image/20171205/1512461830287818.jpg\"/><img title=\"1512461836218214.jpg\" alt=\"timg3_副本.jpg\" src=\"/ueditor/php/upload/image/20171205/1512461836218214.jpg\"/><img title=\"1512461833102683.jpg\" alt=\"timg_副本.jpg\" src=\"/ueditor/php/upload/image/20171205/1512461833102683.jpg\"/></p>', '2', '0.00', '4', '2', '50', '4', '2017-12-07 01:17:44', null, '5', '2017-12-07 01:17:35', '2018-01-06', null, null, '大米（Rice），是稻谷经清理、砻谷、碾米、成品整理等工序后制成的成品。 稻谷的胚与糊粉层中含有近64%的稻米营养和90%以上的人体所须的营养元素，是南方人民的主要食品。熬成米粥具有补脾、和胃、清肺功效。', '2');
INSERT INTO `sys_o2order` VALUES ('21', '20171207011803ID4', '36', '大白菜', 'http://47.92.129.85/uploadfiles/2017/12/201712051414275720_thumb.jpg', '<p><img src=\"/ueditor/php/upload/image/20171205/1512454447777494.jpg\" title=\"1512454447777494.jpg\" alt=\"timg.jpg\"/><img src=\"/ueditor/php/upload/image/20171205/1512454462756696.jpg\" title=\"1512454462756696.jpg\" alt=\"timg99.jpg\"/><img src=\"/ueditor/php/upload/image/20171205/1512454456680517.jpg\" title=\"1512454456680517.jpg\" alt=\"timg55.jpg\"/></p>', '2', '0.00', '4', '1', '50', '4', '2017-12-07 01:18:11', null, '3', '2017-12-07 01:18:03', '2018-01-06', null, '2017-12-12 10:31:58', '形状正常的蔬菜，一般是常规栽培、未用激素等化学品处理过的，可以放心地食用。“异常”蔬菜则可能用激素处理过，如韭菜，当它的叶子特别宽大肥厚，比一般宽叶还要宽1倍时，就可能在栽培过程中用过激素。未用过激素的叶较窄，吃时香味浓郁。', '2');
INSERT INTO `sys_o2order` VALUES ('22', '20171207011954ID4', '41', '蘑菇', 'http://47.92.129.85/uploadfiles/2017/12/201712051506005347_thumb.jpg', '<p><img src=\"/ueditor/php/upload/image/20171205/1512457526871218.jpg\" title=\"1512457526871218.jpg\" alt=\"微信图片_20171205150347.jpg\"/><img src=\"/ueditor/php/upload/image/20171205/1512457547771083.jpg\" title=\"1512457547771083.jpg\" alt=\"微信图片_20171205150351.jpg\"/><img src=\"/ueditor/php/upload/image/20171205/1512457553570005.jpg\" title=\"1512457553570005.jpg\" alt=\"微信图片_20171205150355.jpg\"/><img src=\"/ueditor/php/upload/image/20171205/1512457537273832.jpg\" title=\"1512457537273832.jpg\" alt=\"timgCAIPLXXF.jpg\"/></p>', '2', '0.00', '4', '1', '50', '4', '2017-12-07 01:20:03', null, '3', '2017-12-07 01:19:54', '2018-01-06', null, '2017-12-12 10:31:12', '形状正常的蔬菜，一般是常规栽培、未用激素等化学品处理过的，可以放心地食用。“异常”蔬菜则可能用激素处理过，如韭菜，当它的叶子特别宽大肥厚，比一般宽叶还要宽1倍时，就可能在栽培过程中用过激素。未用过激素的叶较窄，吃时香味浓郁。', '2');
INSERT INTO `sys_o2order` VALUES ('23', '20171207104152ID10', '25', '大白菜特价1元1斤，147*/*/45312到家单位划分好对*回电话多喝点会', 'http://47.92.129.85/uploadfiles/2017/12/201712032202464049_thumb.jpg', '', '2', '1.00', '10', '1', '1', '3', '2017-12-07 10:42:14', '4200000028201712079611072483', '4', '2017-12-07 10:41:52', '2018-01-06', null, '2017-12-07 10:43:13', '12\n12\n\n12\n21\n\n12\n21\n12\n\n21\n\n12\n2121\n12\n12\n12', '2');
INSERT INTO `sys_o2order` VALUES ('30', '20171207232751ID4', '76', '花生油', 'http://47.92.129.85/uploadfiles/2017/12/201712060913221837_thumb.jpg', '<p><img src=\"/ueditor/php/upload/image/20171206/1512522745623256.jpg\" title=\"1512522745623256.jpg\" alt=\"粮油区.jpg\"/><img src=\"/ueditor/php/upload/image/20171206/1512522775883520.jpg\" title=\"1512522775883520.jpg\" alt=\"油.jpg\"/></p>', '2', '0.00', '4', '2', '50', '4', '2017-12-07 23:28:00', null, '5', '2017-12-07 23:27:51', '2018-01-06', null, null, '花生油是由花生经过榨油加工制成，味道香浓。花生油淡黄透明，色泽清亮，气味芬芳，滋味可口，是一种比较容易消化的食用油。花生油含不饱和脂肪酸80%以上花生油可防止皮肤皱裂老化，防止血栓形成，还可改善大脑的记忆力，延缓脑功能的衰退。', '2');
INSERT INTO `sys_o2order` VALUES ('32', '20171208170844ID1', '102', '莴苣', 'http://47.92.129.85/uploadfiles/2017/12/201712081407276985_thumb.jpg', '<p><img src=\"/ueditor/php/upload/image/20171208/1512713235605045.jpg\" title=\"1512713235605045.jpg\" alt=\"莴苣3_副本.jpg\"/></p><p><img src=\"/ueditor/php/upload/image/20171208/1512713225276529.jpg\" title=\"1512713225276529.jpg\" alt=\"莴苣2_副本.jpg\"/></p><p><br/></p>', '2', '0.00', '1', '1', '10', '4', '2017-12-08 17:09:04', null, '3', '2017-12-08 17:08:44', '2018-01-07', null, '2017-12-12 10:30:13', '莴苣味道鲜美有香气，口感鲜嫩色泽淡绿，如同碧玉一般，制作菜肴可荤可素，可凉可热，它具有独特的营养价值。含钾量较高，有利于促进排尿，减少对心房的压力，对高血和心脏病患者极为有益。', '2');
INSERT INTO `sys_o2order` VALUES ('34', '20171208170917ID6', '94', '西蓝花', 'http://47.92.129.85/uploadfiles/2017/12/201712081014557339_thumb.jpg', '<p><br/></p><p><img src=\"/ueditor/php/upload/image/20171208/1512699287600641.jpg\" title=\"1512699287600641.jpg\" alt=\"西蓝花4_副本.jpg\"/></p><p><img src=\"/ueditor/php/upload/image/20171208/1512699275434210.jpg\" title=\"1512699275434210.jpg\" alt=\"西蓝花3_副本.jpg\"/></p><p><img src=\"/ueditor/php/upload/image/20171208/1512699265735835.jpg\" title=\"1512699265735835.jpg\" alt=\"西蓝花1_副本.jpg\"/></p>', '2', '0.00', '6', '1', '11', '4', '2017-12-08 17:09:35', null, '3', '2017-12-08 17:09:17', '2018-01-07', null, '2017-12-12 10:29:58', '西蓝花可能最显著的就是具有防癌的功效，菜花含维生素C较多，比大白菜、番茄、芹菜都高，尤其是在防治胃癌、乳腺癌反面效果尤佳。一般人群均可食用，西蓝花品质柔嫩，纤维少，水分多，风味比花椰菜更鲜美。', '2');
INSERT INTO `sys_o2order` VALUES ('35', '20171208170945ID3', '41', '蘑菇', 'http://47.92.129.85/uploadfiles/2017/12/201712051506005347_thumb.jpg', '<p><img src=\"/ueditor/php/upload/image/20171205/1512457526871218.jpg\" title=\"1512457526871218.jpg\" alt=\"微信图片_20171205150347.jpg\"/><img src=\"/ueditor/php/upload/image/20171205/1512457547771083.jpg\" title=\"1512457547771083.jpg\" alt=\"微信图片_20171205150351.jpg\"/><img src=\"/ueditor/php/upload/image/20171205/1512457553570005.jpg\" title=\"1512457553570005.jpg\" alt=\"微信图片_20171205150355.jpg\"/><img src=\"/ueditor/php/upload/image/20171205/1512457537273832.jpg\" title=\"1512457537273832.jpg\" alt=\"timgCAIPLXXF.jpg\"/></p>', '2', '0.00', '3', '1', '50', '4', '2017-12-08 17:10:07', null, '3', '2017-12-08 17:09:45', '2018-01-07', null, '2017-12-12 10:28:58', '形状正常的蔬菜，一般是常规栽培、未用激素等化学品处理过的，可以放心地食用。“异常”蔬菜则可能用激素处理过，如韭菜，当它的叶子特别宽大肥厚，比一般宽叶还要宽1倍时，就可能在栽培过程中用过激素。未用过激素的叶较窄，吃时香味浓郁。', '2');
INSERT INTO `sys_o2order` VALUES ('36', '20171208170950ID1', '98', '山药', 'http://47.92.129.85/uploadfiles/2017/12/201712081123205395_thumb.jpg', '<p><br/></p><p><img src=\"/ueditor/php/upload/image/20171208/1512703394482217.jpg\" title=\"1512703394482217.jpg\" alt=\"山药3_副本.jpg\"/></p><p><img src=\"/ueditor/php/upload/image/20171208/1512703387656413.jpg\" title=\"1512703387656413.jpg\" alt=\"山药2_副本.jpg\"/><img src=\"/ueditor/php/upload/image/20171208/1512703380705169.jpg\" title=\"1512703380705169.jpg\" alt=\"山药1_副本.jpg\"/></p>', '2', '0.00', '1', '1', '32', '4', '2017-12-08 17:10:05', null, '3', '2017-12-08 17:09:50', '2018-01-07', null, '2017-12-12 10:29:24', '山药因其营养丰富，自古以来就被视为物美价廉的补虚佳品，即可作主粮，又可作蔬菜，还可以制成糖葫芦之类的小吃；治疗脾胃虚弱、体倦、食少、虚汗。', '2');
