INSERT INTO `sys_o2order` VALUES ('39', '20171208171121ID1', '40', '黄瓜', 'http://47.92.129.85/uploadfiles/2017/12/201712051441462668_thumb.jpg', '<p><img src=\"/ueditor/php/upload/image/20171205/1512456082745362.gif\" title=\"1512456082745362.gif\" alt=\"timg.gif\"/><img src=\"/ueditor/php/upload/image/20171205/1512456094474199.jpg\" title=\"1512456094474199.jpg\" alt=\"timgCA6W1XX0.jpg\"/><img src=\"/ueditor/php/upload/image/20171205/1512456100117502.jpg\" title=\"1512456100117502.jpg\" alt=\"timg55.jpg\"/><img src=\"/ueditor/php/upload/image/20171205/1512456087295793.jpg\" title=\"1512456087295793.jpg\" alt=\"timg.jpg\"/></p>', '2', '0.00', '1', '1', '19', '4', '2017-12-08 17:11:33', null, '3', '2017-12-08 17:11:21', '2018-01-07', null, '2017-12-12 10:27:24', '形状正常的蔬菜，一般是常规栽培、未用激素等化学品处理过的，可以放心地食用。“异常”蔬菜则可能用激素处理过，如韭菜，当它的叶子特别宽大肥厚，比一般宽叶还要宽1倍时，就可能在栽培过程中用过激素。未用过激素的叶较窄，吃时香味浓郁。', '2');
INSERT INTO `sys_o2order` VALUES ('40', '20171208171140ID3', '99', '金针菇', 'http://47.92.129.85/uploadfiles/2017/12/201712081307318359_thumb.jpg', '<p><img src=\"/ueditor/php/upload/image/20171208/1512709641525070.jpg\" title=\"1512709641525070.jpg\" alt=\"金针菇3_副本.jpg\"/></p><p><img src=\"/ueditor/php/upload/image/20171208/1512709632746322.jpg\" title=\"1512709632746322.jpg\" alt=\"金针菇2_副本.jpg\"/></p><p><img src=\"/ueditor/php/upload/image/20171208/1512709614166821.jpg\" title=\"1512709614166821.jpg\" alt=\"金针菇1_副本.jpg\"/></p>', '2', '0.00', '3', '1', '50', '4', '2017-12-08 17:11:54', null, '3', '2017-12-08 17:11:40', '2018-01-07', null, '2017-12-12 10:27:15', '金针菇为真菌植物门真菌冬菇的子实体，营养丰富，清香扑鼻；其菌盖小巧细腻，黄褐色或淡黄色，干部形金针，不仅味道鲜美，而且营养丰富。是拌凉菜和火锅食品的原料之一。', '2');
