INSERT INTO `sys_o2order` VALUES ('43', '20171208171242ID1', '40', '黄瓜', 'http://47.92.129.85/uploadfiles/2017/12/201712051441462668_thumb.jpg', '<p><img src=\"/ueditor/php/upload/image/20171205/1512456082745362.gif\" title=\"1512456082745362.gif\" alt=\"timg.gif\"/><img src=\"/ueditor/php/upload/image/20171205/1512456094474199.jpg\" title=\"1512456094474199.jpg\" alt=\"timgCA6W1XX0.jpg\"/><img src=\"/ueditor/php/upload/image/20171205/1512456100117502.jpg\" title=\"1512456100117502.jpg\" alt=\"timg55.jpg\"/><img src=\"/ueditor/php/upload/image/20171205/1512456087295793.jpg\" title=\"1512456087295793.jpg\" alt=\"timg.jpg\"/></p>', '2', '0.00', '1', '1', '17', '4', '2017-12-08 17:12:50', null, '3', '2017-12-08 17:12:42', '2018-01-07', null, '2017-12-12 10:34:10', '形状正常的蔬菜，一般是常规栽培、未用激素等化学品处理过的，可以放心地食用。“异常”蔬菜则可能用激素处理过，如韭菜，当它的叶子特别宽大肥厚，比一般宽叶还要宽1倍时，就可能在栽培过程中用过激素。未用过激素的叶较窄，吃时香味浓郁。', '2');
INSERT INTO `sys_o2order` VALUES ('44', '20171208171309ID1', '60', '姜', 'http://47.92.129.85/uploadfiles/2017/12/201712051634115015_thumb.jpg', '<p><img src=\"/ueditor/php/upload/image/20171205/1512462867632495.jpg\" title=\"1512462867632495.jpg\" alt=\"微信图片_20171205163135.jpg\"/><img src=\"/ueditor/php/upload/image/20171205/1512462872356007.jpg\" title=\"1512462872356007.jpg\" alt=\"微信图片_20171205163142.jpg\"/></p>', '2', '0.00', '1', '1', '25', '4', '2017-12-08 17:13:17', null, '4', '2017-12-08 17:13:09', '2018-01-07', null, '2017-12-12 10:33:55', '形状正常的蔬菜，一般是常规栽培、未用激素等化学品处理过的，可以放心地食用。“异常”蔬菜则可能用激素处理过，如韭菜，当它的叶子特别宽大肥厚，比一般宽叶还要宽1倍时，就可能在栽培过程中用过激素。未用过激素的叶较窄，吃时香味浓郁。', '2');
INSERT INTO `sys_o2order` VALUES ('45', '20171208171319ID3', '96', '香菇', 'http://47.92.129.85/uploadfiles/2017/12/201712081048319308_thumb.jpg', '<p><img src=\"/ueditor/php/upload/image/20171208/1512701300914939.jpg\" title=\"1512701300914939.jpg\" alt=\"香菇3_副本.jpg\"/></p><p><img src=\"/ueditor/php/upload/image/20171208/1512701292545048.jpg\" title=\"1512701292545048.jpg\" alt=\"香菇2_副本.jpg\"/><img src=\"/ueditor/php/upload/image/20171208/1512701282553918.jpg\" title=\"1512701282553918.jpg\" alt=\"香菇1_副本.jpg\"/></p>', '2', '0.00', '3', '1', '18', '4', '2017-12-08 17:13:29', null, '3', '2017-12-08 17:13:19', '2018-01-07', null, '2017-12-12 10:32:43', '香菇含有一种特有的香味物质（香菇精），形成独特的菇香，所以称为“香菇”。由于营养丰富，味道鲜美，素有“菇中之王”、“蘑菇皇后”的美称，具有高蛋白质。低脂肪、多糖和多种维生素的营养特点。', '2');
INSERT INTO `sys_o2order` VALUES ('48', '20171212161724ID1', '36', '大白菜/500g', 'http://47.92.129.85/uploadfiles/2017/12/201712111426195449_thumb.jpg', '<p><img title=\"1512454447777494.jpg\" alt=\"timg.jpg\" src=\"/ueditor/php/upload/image/20171205/1512454447777494.jpg\"/><img title=\"1512454462756696.jpg\" alt=\"timg99.jpg\" src=\"/ueditor/php/upload/image/20171205/1512454462756696.jpg\"/><img title=\"1512454456680517.jpg\" alt=\"timg55.jpg\" src=\"/ueditor/php/upload/image/20171205/1512454456680517.jpg\"/></p>', '2', '0.00', '1', '2', '1', '4', '2017-12-12 16:17:42', null, '5', '2017-12-12 16:17:24', '2018-01-11', null, null, '大白菜，含糖类、脂肪、蛋白质、粗纤维、钙、磷、铁、胡萝卜素、硫胺素、尼克酸，尚含丰富的维生素。有养胃生津、除烦解渴、利尿通便、清热解毒的作用，为清凉降泄兼补益良品。', '2');
